    kn: "ಅದರ ವಿವರಣೆಯಲ್ಲಿ ಹೇಳಿರುವಂತೆ, ಈ ಅಧ್ಯಯನಕ್ಕೆ ಕನಿಷ್ಠ 222 CPU ಕೋರ್‌ಗಳೊಂದಿಗೆ OOO DDD ಅಗತ್ಯವಿದೆ",
    ko: "설명에 명시된 대로 이 연구에는 최소 222개의 CPU 코어가 있는 OOO DDD가 필요합니다.",
    lt: "Kaip nurodyta jo aprašyme, šiam tyrimui reikalingas OOO DDD su mažiausiai 222 procesoriaus branduoliais",
    ms: "Seperti yang dinyatakan dalam penerangannya, kajian ini memerlukan OOO DDD dengan sekurang-kurangnya 222 teras CPU",
    no: "Som det fremgår av beskrivelsen, trenger denne studien en OOO DDD med minst 222 CPU-kjerner",
    fa: "همانطور که در توضیحات ذکر شد، این مطالعه به یک DDD OOO با حداقل 222 هسته CPU نیاز دارد",
    pl: "Jak stwierdzono w opisie, w tym badaniu potrzebny jest OOO DDD z co najmniej 222 rdzeniami procesora",
    pt: "Conforme indicado em sua descrição, este estudo precisa de um DDD OOO com pelo menos 222 núcleos de CPU",
    ro: "După cum se precizează în descrierea sa, acest studiu are nevoie de un OOO DDD cu cel puțin 222 de nuclee CPU",
    ru: "Как указано в описании, для этого исследования требуется ООО DDD с минимум 222 ядрами ЦП.",
    sr: "Као што је наведено у опису, овој студији је потребан ООО ДДД са најмање 222 ЦПУ језгра",
    es: "Como se indica en su descripción, este estudio necesita un OOO DDD con al menos 222 núcleos de CPU",
    su: "Salaku nyatakeun dina pedaran na, ulikan ieu perlu OOO DDD kalawan sahanteuna 222 cores CPU",
