    id: "⚠ PERHATIAN. Apakah Anda ingat untuk:\n ‣ memaksimalkan volume suara komputer?\n ‣ lepaskan casing ponsel?\nJika tidak, tekan REKAM ULANG, perbaiki masalahnya, dan LANJUTKAN.",
