    ar: "⚠ نظرًا لأن هذه الدراسة ستقوم بمعايرة الميكروفونات (_calibrateSoundMicrophonesBool==TRUE)، فستحتاج إلى ميكروفون USB (miniDSP UMIK-1 أو UMIK-2) لمعايرة مكبرات الصوت لديك.",
    hy: "⚠ Քանի որ այս ուսումնասիրությունը կկալիբրացնի խոսափողները (_calibrateSoundMicrophonesBool==TRUE), ձեզ անհրաժեշտ կլինի USB խոսափող (miniDSP UMIK-1 կամ UMIK-2)՝ ձեր բարձրախոսները չափորոշելու համար:",
