      "⚠ 由於本研究將校準麥克風 (_calibrateSoundMicrophonesBool==TRUE)，因此您將需要 USB 麥克風（miniDSP UMIK-1 或 UMIK-2）來校準揚聲器。",
    hr: "⚠ Budući da će ova studija kalibrirati mikrofone (_calibrateSoundMicrophonesBool==TRUE), trebat će vam USB mikrofon (miniDSP UMIK-1 ili UMIK-2) za kalibraciju vaših zvučnika.",
    cs: "⚠ Protože tato studie bude kalibrovat mikrofony (_calibrateSoundMicrophonesBool==TRUE), budete ke kalibraci svých reproduktorů potřebovat USB mikrofon (miniDSP UMIK-1 nebo UMIK-2).",
    da: "⚠ Fordi denne undersøgelse vil kalibrere mikrofoner (_calibrateSoundMicrophonesBool==TRUE), skal du bruge en USB-mikrofon (miniDSP UMIK-1 eller UMIK-2) til at kalibrere dine højttalere.",
    nl: "⚠ Omdat in dit onderzoek microfoons worden gekalibreerd (_calibrateSoundMicrophonesBool==TRUE), hebt u een USB-microfoon (miniDSP UMIK-1 of UMIK-2) nodig om uw luidsprekers te kalibreren.",
    "en-UK":
      "⚠ Because this study will calibrate microphones (_calibrateSoundMicrophonesBool==TRUE), you will need a USB microphone (miniDSP UMIK-1 or UMIK-2) to calibrate your loudspeakers.",
    "en-US_1":
      "⚠ Because this study will calibrate microphones (_calibrateSoundMicrophonesBool==TRUE), you will need a USB microphone (miniDSP UMIK-1 or UMIK-2) to calibrate your loudspeakers.",
    fi: "⚠ Koska tämä tutkimus kalibroi mikrofonit (_calibrateSoundMicrophonesBool==TRUE), tarvitset USB-mikrofonin (miniDSP UMIK-1 tai UMIK-2) kaiuttimiesi kalibrointiin.",
    fr: "⚠ Parce que cette étude calibrera des microphones (_calibrateSoundMicrophonesBool==TRUE), vous aurez besoin d'un microphone USB (miniDSP UMIK-1 ou UMIK-2) pour calibrer vos haut-parleurs.",
    de: "⚠ Da in dieser Studie Mikrofone kalibriert werden (_librateSoundMicrophonesBool==TRUE), benötigen Sie ein USB-Mikrofon (miniDSP UMIK-1 oder UMIK-2), um Ihre Lautsprecher zu kalibrieren.",
    el: "⚠ Επειδή αυτή η μελέτη θα βαθμονομήσει μικρόφωνα (_calibrateSoundMicrophonesBool==TRUE), θα χρειαστείτε ένα μικρόφωνο USB (miniDSP UMIK-1 ή UMIK-2) για τη βαθμονόμηση των μεγαφώνων σας.",
    he: "⚠ מכיוון שהמחקר הזה יכייל מיקרופונים (_calibrateSoundMicrophonesBool==TRUE), תזדקק למיקרופון USB (miniDSP UMIK-1 או UMIK-2) כדי לכייל את הרמקולים שלך.",
    hi: "⚠ क्योंकि यह अध्ययन माइक्रोफोन को कैलिब्रेट करेगा (_calibrateSoundMicrophonesBool==TRUE), आपको अपने लाउडस्पीकर को कैलिब्रेट करने के लिए एक USB माइक्रोफोन (मिनीDSP UMIK-1 या UMIK-2) की आवश्यकता होगी।",
    hu: "⚠ Mivel ez a tanulmány mikrofonokat kalibrál (_calibrateSoundMicrophonesBool==TRUE), a hangszórók kalibrálásához USB-mikrofonra (miniDSP UMIK-1 vagy UMIK-2) lesz szüksége.",
    is: "⚠ Vegna þess að þessi rannsókn mun kvarða hljóðnema (_calibrateSoundMicrophonesBool==TRUE), þarftu USB hljóðnema (miniDSP UMIK-1 eða UMIK-2) til að kvarða hátalarana þína.",
    id: "⚠ Karena penelitian ini akan mengkalibrasi mikrofon (_calibrateSoundMicrophonesBool==TRUE), Anda memerlukan mikrofon USB (miniDSP UMIK-1 atau UMIK-2) untuk mengkalibrasi loudspeaker Anda.",
    it: "⚠ Poiché questo studio calibrerà i microfoni (_calibrateSoundMicrophonesBool==TRUE), avrai bisogno di un microfono USB (miniDSP UMIK-1 o UMIK-2) per calibrare i tuoi altoparlanti.",
    ja: "⚠ この調査ではマイクを調整するため (_calibrateSoundMicrophonesBool==TRUE)、ラウドスピーカーを調整するには USB マイク (miniDSP UMIK-1 または UMIK-2) が必要になります。",
    kn: "⚠ ಏಕೆಂದರೆ ಈ ಅಧ್ಯಯನವು ಮೈಕ್ರೊಫೋನ್‌ಗಳನ್ನು ಮಾಪನಾಂಕ ಮಾಡುತ್ತದೆ (_calibrateSoundMicrophonesBool==TRUE), ನಿಮ್ಮ ಧ್ವನಿವರ್ಧಕಗಳನ್ನು ಮಾಪನ ಮಾಡಲು ನಿಮಗೆ USB ಮೈಕ್ರೊಫೋನ್ (miniDSP UMIK-1 ಅಥವಾ UMIK-2) ಅಗತ್ಯವಿದೆ.",
    ko: "⚠ 이 연구에서는 마이크(_calibrateSoundMicrophonesBool==TRUE)를 교정할 것이므로 스피커를 교정하려면 USB 마이크(miniDSP UMIK-1 또는 UMIK-2)가 필요합니다.",
