    ms: "⚠ Oleh kerana kajian ini akan menentukur mikrofon (_calibrateSoundMicrophonesBool==TRUE), anda memerlukan mikrofon USB (miniDSP UMIK-1 atau UMIK-2) untuk menentukur pembesar suara anda.",
