    fa: "⚠ از آنجا که این مطالعه میکروفون ها را کالیبره می کند (_calibrateSoundMicrophonesBool==TRUE)، برای کالیبره کردن بلندگوهای خود به یک میکروفون USB (miniDSP UMIK-1 یا UMIK-2) نیاز دارید.",
