    ur: "فوری کمیونیکیشن چیک کرنے کے لیے، اپنے فون کے کیمرہ کو نیچے QR کوڈ پر پوائنٹ کریں اور اس لنک کو تھپتھپائیں جو آپ کے فون کی اسکرین پر ظاہر ہوتا ہے۔",
