    fi: "❌ YHTEENSOPImaton. Anteeksi. Voit kokeilla toista selainta tai tietokonetta tai mitä tahansa yhteensopivaa. Muussa tapauksessa paina CANCEL palauttaaksesi tämän tutkimuksen Prolific.com-sivustolle.",
