    el: "❌ ΑΣΥΜΒΑΤΟ. Συγνώμη. Μπορείτε να δοκιμάσετε άλλο πρόγραμμα περιήγησης, υπολογιστή ή οτιδήποτε άλλο μπορεί να είναι συμβατό. Διαφορετικά, πατήστε ΑΚΥΡΩΣΗ για να επιστρέψετε αυτήν τη μελέτη στο Prolific.com.",
    he: "❌ לא תואם. מצטער. אתה מוזמן לנסות דפדפן אחר, או מחשב אחר, או כל דבר אחר שעשוי להיות תואם. אחרת, לחץ על ביטול כדי להחזיר את המחקר הזה ל-Prolific.com.",
    hi: "❌ असंगत। क्षमा मांगना। किसी अन्य ब्राउज़र, या कंप्यूटर, या जो भी संगत हो, उसे आज़माने के लिए आपका स्वागत है। अन्यथा इस अध्ययन को Prolific.com पर वापस करने के लिए CANCEL दबाएँ।",
    hu: "❌ INCOMPATIBILIS. Sajnálom. Szívesen próbáljon ki egy másik böngészőt, számítógépet vagy bármit, ami kompatibilis. Ellenkező esetben nyomja meg a MÉGSE gombot, hogy visszaküldje ezt a tanulmányt a Prolific.com webhelyre.",
    is: "❌ Ósamrýmanlegt. Því miður. Þér er velkomið að prófa annan vafra, eða tölvu, eða hvað sem gæti verið samhæft. Annars smelltu á CANCEL til að skila þessari rannsókn á Prolific.com.",
    id: "❌ TIDAK SESUAI. Maaf. Anda boleh mencoba browser lain, atau komputer, atau apa pun yang mungkin kompatibel. Jika tidak, tekan BATAL untuk mengembalikan studi ini ke Prolific.com.",
    it: "❌INCOMPATIBILE. Scusa. Puoi provare un altro browser, computer o qualunque cosa possa essere compatibile. Altrimenti premi ANNULLA per restituire questo studio a Prolific.com.",
    ja: "❌ 互換性がありません。ごめん。別のブラウザやコンピュータなど、互換性のあるものを試してみてください。それ以外の場合は、[キャンセル] をクリックしてこの研究を Prolific.com に戻します。",
    kn: "❌ ಹೊಂದಾಣಿಕೆಯಾಗುವುದಿಲ್ಲ. ಕ್ಷಮಿಸಿ. ಇನ್ನೊಂದು ಬ್ರೌಸರ್, ಅಥವಾ ಕಂಪ್ಯೂಟರ್ ಅಥವಾ ಯಾವುದಾದರೂ ಹೊಂದಾಣಿಕೆಯನ್ನು ಪ್ರಯತ್ನಿಸಲು ನಿಮಗೆ ಸ್ವಾಗತ. ಇಲ್ಲವಾದರೆ ಈ ಅಧ್ಯಯನವನ್ನು Prolific.com ಗೆ ಹಿಂತಿರುಗಿಸಲು CANCEL ಅನ್ನು ಒತ್ತಿರಿ.",
    ko: "❌ 호환되지 않습니다. 죄송합니다. 다른 브라우저나 컴퓨터 또는 호환 가능한 모든 것을 사용해 보세요. 그렇지 않으면 취소를 눌러 이 연구를 Prolific.com으로 되돌리세요.",
    lt: "❌ NESUDERINAMAS. Atsiprašau. Kviečiame išbandyti kitą naršyklę, kompiuterį ar bet ką, kas gali būti suderinama. Kitu atveju paspauskite ATŠAUKTI, kad grąžintumėte šį tyrimą į Prolific.com.",
    ms: "❌ TAK SESUAI. Maaf. Anda dialu-alukan untuk mencuba pelayar lain, atau komputer, atau apa sahaja yang mungkin serasi. Jika tidak, tekan CANCEL untuk mengembalikan kajian ini kepada Prolific.com.",
    no: "❌ INKOMPATIBEL. Beklager. Du er velkommen til å prøve en annen nettleser, eller datamaskin, eller hva som måtte være kompatibelt. Ellers trykk AVBRYT for å returnere denne studien til Prolific.com.",
    fa: "❌ ناسازگار. متاسف. می توانید مرورگر یا رایانه دیگری یا هر چیزی که ممکن است سازگار باشد را امتحان کنید. در غیر این صورت CANCEL را بزنید تا این مطالعه به Prolific.com برگردد.",
    pl: "❌ NIEKOMPATYBILNY. Przepraszam. Możesz wypróbować inną przeglądarkę, komputer lub cokolwiek innego, co może być kompatybilne. W przeciwnym razie naciśnij ANULUJ, aby zwrócić to badanie do Prolific.com.",
    pt: "❌INCOMPATÍVEL. Desculpe. Você pode tentar outro navegador, ou computador, ou qualquer outro que seja compatível. Caso contrário, clique em CANCELAR para devolver este estudo ao Prolific.com.",
    ro: "❌ INCOMPATIBIL. Îmi pare rău. Sunteți binevenit să încercați un alt browser, sau computer, sau orice ar putea fi compatibil. În caz contrar, apăsați CANCEL pentru a returna acest studiu la Prolific.com.",
    ru: "❌НЕСОВМЕСТИМОСТЬ. Извини. Вы можете попробовать другой браузер, компьютер или что-то еще, что может быть совместимо. В противном случае нажмите «ОТМЕНА», чтобы вернуть это исследование на Prolific.com.",
    sr: "❌ НЕКОМПАТИБИЛНО. Извињавам се. Можете испробати други прегледач, рачунар или било шта друго компатибилно. У супротном притисните Откажи да бисте ову студију вратили на Пролифиц.цом.",
    es: "❌INCOMPATIBLES. Lo siento. Le invitamos a probar con otro navegador, computadora o cualquier otro que sea compatible. De lo contrario, presione CANCELAR para devolver este estudio a Prolific.com.",
    su: "❌ Teu cocog. Hapunten. Anjeun wilujeng sumping pikeun nyobaan browser sejen, atawa komputer, atawa naon bae anu bisa jadi cocog. Upami teu kitu, pencét CANCEL pikeun mulangkeun pangajaran ieu ka Prolific.com.",
    sw: "❌ HAIWEZEKANI. Pole. Unakaribishwa kujaribu kivinjari kingine, au kompyuta, au chochote kinachoweza kutumika. Vinginevyo gonga CANCEL ili kurudisha utafiti huu kwa Prolific.com.",
