    he: "שלום xxx. כל פרופיל שאתה תורם לספריית הפרופילים יוטבע עם האימייל שלך xxx, לזכות תרומתך.",
    hi: "नमस्ते xxx. प्रोफ़ाइल लाइब्रेरी में आपके द्वारा योगदान की गई प्रत्येक प्रोफ़ाइल पर आपके योगदान को श्रेय देने के लिए आपके ईमेल xxx की मुहर लगाई जाएगी।",
    hu: "Szia xxx! Minden profilt, amelyet a profilkönyvtárban közreműködsz, a xxx e-mail-címmel látjuk el, hogy jóváírjuk hozzájárulását.",
    is: "Halló xxx. Sérhver prófíll sem þú leggur inn í prófílsafnið verður stimplaður með tölvupóstinum þínum xxx, til að gefa framlag þitt til heiðurs.",
    id: "Halo xxx. Setiap profil yang Anda kontribusikan ke perpustakaan profil akan dicap dengan email xxx Anda, sebagai kredit atas kontribusi Anda.",
    it: "Ciao xxx. Ogni profilo che contribuisci alla libreria dei profili verrà contrassegnato con la tua email xxx, per accreditare il tuo contributo.",
    ja: "こんにちは、xxx。あなたがプロファイル ライブラリに投稿した各プロファイルには、あなたの貢献を示すためにあなたの電子メール xxx のスタンプが押されます。",
