    su: "Hatur nuhun pikeun ilubiung dina survey urang. Entong lirén. Pencét Teruskeun supados urang tiasa ngahémat hasil sareng alihan anjeun deui ka Prolific kalayan kode parantosan anjeun. hatur nuhun.",
    sw: "Asante kwa kushiriki katika utafiti wetu. Usiache. Gonga Endelea ili tuweze kuhifadhi matokeo na kukuelekeza kwenye Prolific ukitumia msimbo wako wa kukamilisha. Asante.",
