    pl: "Przesunięcie linii waha się od dużego i łatwego do małego i trudnego. Nie możesz uzyskać więcej niż dwie trzecie, więc zrelaksuj się. Potraktuj to jak grę w zgadywanie i zdobądź ich jak najwięcej. Za każdym razem, gdy będziesz miał rację, usłyszysz sygnał dźwiękowy.",
