    ro: "Deplasarea liniei variază de la mare și ușor până la mic și greu. Nu poți să înțelegi mai mult de două treimi, așa că relaxează-te. Gândiți-vă la el ca la un joc de ghicituri și obțineți cât mai multe. Vei auzi un bip ori de câte ori ai dreptate.",
    ru: "Сдвиг лески варьируется от большого и легкого до крошечного и жесткого. Вы не сможете ответить правильно больше, чем на две трети, так что расслабьтесь. Думайте об этом как об игре в угадайку и просто соберите как можно больше. Вы услышите звуковой сигнал, когда окажетесь правы.",
