    es: "El cambio de línea varía desde grande y fácil hasta pequeño y duro. No puedes acertar mucho más de dos tercios, así que relájate. Piensa en ello como un juego de adivinanzas y consigue tantos como puedas. Escucharás un pitido cada vez que tengas razón.",
    su: "Garis shift beda-beda ti badag tur gampang ka handap pikeun leutik tur teuas. Anjeun teu bisa meunang leuwih ti dua per tilu katuhu, jadi bersantai. Mikir salaku kaulinan guessing, sarta ngan meunang saloba Anjeun tiasa. Anjeun bakal ngadangu sora bip iraha waé anjeun leres.",
