    fi: "Jos tämä näyttö jumiutuu, yhdistä uudelleen suuntaamalla älypuhelimen kamera tietokoneen näytöllä olevaan QR-koodiin. Kun linkki tulee näkyviin, kosketa sitä sormella.",
