    hi: "यदि यह स्क्रीन फ़्रीज़ हो जाती है, तो कृपया अपने स्मार्टफ़ोन कैमरे को अपने कंप्यूटर स्क्रीन पर क्यूआर कोड पर इंगित करके पुनः कनेक्ट करें। जब कोई लिंक दिखाई दे तो उसे अपनी उंगली से स्पर्श करें.",
    hu: "Ha ez a képernyő lefagy, kérjük, csatlakozzon újra úgy, hogy okostelefonjának kameráját a számítógép képernyőjén megjelenő QR-kódra irányítja. Amikor megjelenik egy hivatkozás, érintse meg az ujjával.",
    is: "Ef þessi skjár frýs, vinsamlegast tengdu aftur með því að beina myndavél snjallsímans að QR kóðanum á tölvuskjánum þínum. Þegar hlekkur birtist skaltu snerta hann með fingrinum.",
    id: "Jika layar ini macet, silakan sambungkan kembali dengan mengarahkan kamera ponsel cerdas Anda ke kode QR di layar komputer Anda. Saat tautan muncul, sentuh dengan jari Anda.",
    it: "Se questa schermata si blocca, riconnettiti puntando la fotocamera dello smartphone verso il codice QR sullo schermo del computer. Quando viene visualizzato un collegamento, toccalo con il dito.",
