    ko: "화면이 멈추는 경우 스마트폰 카메라를 컴퓨터 화면의 QR 코드로 향하게 하여 다시 연결하세요. 링크가 나타나면 손가락으로 터치하세요.",
    lt: "Jei šis ekranas užšąla, vėl prisijunkite nukreipdami išmaniojo telefono kamerą į QR kodą kompiuterio ekrane. Kai pasirodys nuoroda, palieskite ją pirštu.",
    ms: "Jika skrin ini membeku, sila sambung semula dengan menghalakan kamera telefon pintar anda pada kod QR pada skrin komputer anda. Apabila pautan muncul, sentuh dengan jari anda.",
    no: "Hvis denne skjermen fryser, må du koble til igjen ved å peke smarttelefonkameraet mot QR-koden på dataskjermen. Når en kobling vises, trykker du på den med fingeren.",
    fa: "اگر این صفحه یخ زد، لطفاً با اشاره دوربین تلفن هوشمند خود به سمت کد QR روی صفحه رایانه، دوباره وصل شوید. وقتی پیوندی ظاهر شد، آن را با انگشت خود لمس کنید.",
    pl: "Jeśli ekran się zawiesi, podłącz ponownie, kierując aparat smartfona na kod QR na ekranie komputera. Gdy pojawi się link, dotknij go palcem.",
